import React from 'react';
import * as FaIcons from 'react-icons/fa';

export const SidebarData = [
  {
    title: 'Use Help',
    path: '/usage-help',
    icon: <FaIcons.FaGraduationCap/>,
  },
  {
    title: 'Services',
    path: '/services',
    icon: <FaIcons.FaLaptopCode />,
  },
  {
    title: 'Questions',
    path: '/questions',
    icon: <FaIcons.FaQuestion />
  },
  {
    title: 'About us',
    path: '/about',
    icon: <FaIcons.FaUniversity />
  },

];
